import {
    BrowserRouter as Router,
    Route,
  } from "react-router-dom";
  import React from 'react';
  import CarTable from './Components/'

const routes = (
  <Router>
      <Route path = "/" component = {CarTable} exact = {true} />
  </Router>
);

export default routes;
